  summary: "\nImplementation of <xref href=\"SuperOffice.CRM.IContactInfo\" data-throw-if-not-resolved=\"false\"></xref>; create through factory (see remarks)\n"
  remarks: "\nTo create an instance of ContactInfoProvider, use \n<pre><code>var info = ClassFactory.Create&lt;IContactInfo>(cont);</code></pre>\nwhere cont is a <xref href=\"SuperOffice.CRM.Entities.Contact\" data-throw-if-not-resolved=\"false\"></xref>, to use an\nalready-loaded entity object (that may also contain unsaved data);\nor where cont is an int that is a contactId, which will cause database fetches. \nThe factory methods at the bottom of this class will handle both cases.\n<p></p>\nIf you are in the Cpp world, or otherwise have unsaved data that you would\nwant to use without incurring the overhead of an entity object, instantiate\na <xref href=\"SuperOffice.CRM.Entities.Providers.SimpleContactInfo\" data-throw-if-not-resolved=\"false\"></xref> instead, fully populate it, and pass that to the factory.\n"
